.section5 {
    padding: 8rem 0;
    
    .wrapper5 {
        display: flex;
        justify-content: center;
        align-items: center;
        flex-flow: row nowrap;

        .block-left {
            box-sizing: border-box;
            flex: 0.5;
            padding: 0 10%;

            .comment {
                margin-top: 2.2rem;
                margin-bottom: 2.3rem;
                
            }

            .desc {
                color: #494848;
            }

            .button-block {
                display: flex;
                align-items: center;
                font-family: Roboto, sans-serif;
                margin-top: 3rem;
                i {
                    font-size: 3.5rem;
                    color: #615cfd;
                    border-radius: 30px;
                    margin-right: 1.2rem;
                }

                .button-text {
                    font-size: 1.2rem;
                }
            }
        }

        .block-right {
            flex: 0.7;
            .img-box {
                display: flex;
                flex-direction: row;
                justify-content: flex-end;
                img{
                    border-top-left-radius: 15px;
                    border-bottom-left-radius: 15px;
                    width: auto;
                    height: auto;
                    max-width: 100%;
                    max-height: 80%;
                    object-fit: contain;
                }
            }
        }
    }


@media screen and (min-width: 320px) and (max-width: 768px){
    padding: 3rem 0;
    .wrapper5 {
        display: block;

        .block-right {
            display: none;
        }

        .block-left {
            padding: 0 2.2%;
            box-sizing: border-box;

            .title {
                font-size: 1.8rem;
            }

            .comment {
                margin: 5% 0 5%;
                
            }
        }
    }
}

@media screen and (min-width: 769px) and (max-width: 992px){
    .wrapper5 {
        display: block;

        .block-left {
            box-sizing: border-box;
            padding: 0 7%;

            .comment {
                margin: 3% 0 3%;
                
            }
        }

        .block-right {
            display: none;
        }
    }

}


