.section6 {
    padding: 8rem 0;
    .wrapper6 {

        .section6__block-top {
            display: flex;
            flex-flow: column nowrap;
            justify-content: center;
            align-items: center;

            .desc {
                text-align: center;
                width: 28rem;
            }
        }

        .section6__block-bottom {
            display: flex;
            justify-content: space-around;
            width: 100%;
            padding: 0 4rem;

            .section6__block-bottom__wrapper{
                display: inherit;
                flex-flow: column nowrap;
                justify-content: center;
                align-items: center;

                .name {
                    margin-top: 1rem;
                    margin-bottom: 0.5rem;
                }

                .desc {
                    margin: 0;

                }
            }
        }
    }
}

.section7 {
    .wrapper7 {
        color: #ffffff;
        position: relative;
        .section7-background {
            opacity: 0.7;
        }

        .contents-block {
            position: absolute;
            display: flex;
            justify-content: center;
            align-items: center;
            flex-flow: column nowrap;
            padding: 1rem 3.73rem;

            .quote {
                margin-bottom: 1.9rem;
            }

            .desc {
                color: #ffffff;
                font-size: 1.5rem;
                text-align: center;
                line-height: 2rem;
                margin: 0;
            }

            .profile-box {
                display: flex;
                flex-flow: column nowrap;
                justify-content: center;
                align-items: center;

                .profile-img {
                    width: 2.5rem;
                    height: 2.5rem;
                    border-radius: 25px;
                    overflow: hidden;
                    margin: 1rem auto;
                    img {
                        width: 100%;
                        height: 100%;
                    }
                }
                .career {
                    font-size: 0.8rem;
                    margin-top: 0.5rem;
                }
            }
        }
    }
}

.section8 {
    .wrapper8 {
        padding: 8rem 0;
        .section8__block-top {
            display: flex;
            flex-flow: column nowrap;
            justify-content: center;
            align-items: center;

            .text-contents-box {
                display: inherit;
                flex-flow: inherit;
                justify-content: inherit;
                align-items: inherit;
                width: 70%;
                .title, .desc {
                    text-align: center;
                }
            }

        }

        .section8__block-bottom {
            display: flex;
            flex-flow:column nowrap;
            justify-content: center;
            align-items: center;
            width: 75%;
            padding: 3rem 14rem;

            input,textarea {
                border-radius: 25px;
                padding: 0.9rem 1rem;
                outline: none;
                border: 1px solid  #8080807a;
            }

            & > div {
                margin: 0.6rem;
            }

            .input-box1 {
                display: inherit;
                width: 100%;
                justify-content: space-between;

                input {
                    flex: 0.48;
                }
            }
            .input-box2 {
                display: inherit;
                width: 100%;

                input {
                    width: 100%;
                }
            }

            .input-box3 {
                display: inherit;
                width: 100%;

                textarea {
                    display: inherit;
                    width: 100%;
                }
            }

            .submit-box {
                display: inherit;
                width: 100%;

                input {
                    @include buttonStyle;
                    width: 100%;
                    cursor: pointer;
                    
                }
            }
        }
    }

}
